import styled from 'styled-components';

export const Container = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  width: 100%;
  height: 100%;
  max-height: 650px;
  max-width: 600px;
`;

export const ContainerImg = styled.img`
  width: 100%;
  height: 100%;
  border-radius: 6px;
`;
